import React from 'react';
import '../Style/Header.css'; // Si tienes tu archivo CSS
import logo from '../images/logo.png'; // Ruta correcta dentro de la carpeta src

const Header = () => {
  return (
    <header className="bg-green-600 text-white py-4 px-8 flex items-center shadow-md">
      {/* Logo */}
      <div className="flex items-center">
        <img src={logo} alt="Logo" className="header-logo" /> {/* Aquí se añade el logo */}
        <span className="bg-white text-green-600 font-bold px-2 py-1 text-lg rounded-md header-title">
          CONECTA
        </span>
      </div>
    </header>
  );
};

export default Header;
